import { Component } from '@angular/core';
import { Router } from '@angular/router';

@Component({
  selector: 'app-yuca',
  templateUrl: './yuca.component.html',
  styleUrls: ['./yuca.component.scss'],
})
export class YucaComponent {
  constructor(private router: Router) {}

  goToComponentB() {
    this.router.navigate(['/yuca_ejemplos']);
  }
}
<!DOCTYPE html>
<html lang="en">
<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="width=device-width, initial-scale=1.0">
  <title>YUCA</title>
</head>
<body>
  <div class="container">
    <h1>Deep Learning con hoja de yuca</h1>
    <div class="button-container">
      <button (click)="goToComponentB()" id="button1">Ejemplos</button>
      <button id="button2">Modelo</button>
    </div>
  </div>
</body>
</html>
